import React from 'react';
import TextField from '@mui/material/TextField';
import Button from '@mui/material/Button';

function LoginPage() {
  const handleLogin = () => {
    // Add your login logic here
    console.log('Login button clicked');
  };

  return (
    <div style={{
      display: 'flex',
      flexDirection: 'column',
      alignItems: 'center',
      justifyContent: 'center',
      height: '100vh', // Set to full viewport height
    }}>
      <div style={{ padding: '20px', width: '300px', textAlign: 'center' }}>
        <TextField id="filled-username" label="Username" variant="filled" margin="normal" fullWidth />
        <TextField id="filled-password" label="Password" type="password" variant="filled" margin="normal" fullWidth />
        <Button variant="contained" color="primary" onClick={handleLogin} style={{ marginTop: '20px' }} fullWidth>
          Login
        </Button>
      </div>
    </div>
  );
}

export default LoginPage;
